text:
Sure.  AFTER I move from Melrose, one of my favorite stores moves there.  
I needed a new T-shirt and, of course, wanted something different.  Their new location feels roomier than the old one on 7th Street.  A cute calico cat greeted me at the door and followed me to the shirt rack.
Their selection of girl t-shirts was small, which is why I took a star away.  But, other than that, they still have all the funky shiznit you'd expect!  I was on my lunch break, so in a hurry, didn't have much time to browse.  I'll be back this weekend to buy Xmas presents.  For mySELF! ;}

I can't freaking believe I haven't reviewed Short Leash yet!!!!!!!  
I go pretty much every Friday to the Downtown Phoenix Public Market food truck court.  Is that a mouthful or what?????
I make a beeline here.  Not only are these people totally kick-ass but so are the hot dogs.
I try to get a different one each time, but I always end up with the one that's got the jalapenos on it.  I don't remember the names ever.  I am there to eat, not read, but I think it's the Igby.
They have a new one I learned about last night, the "Lady," and my mouth is watering right now at my desk.  I will be trying it out today for lunch. :}
Oh, and when business owners remember the names of their customers, they are tops in my book.  After all, I may be eating their hot dog, but it's still....all about me.  ;}

What do I love about Club Red/Red Owl?  It's two venues in one!  I am there just about every weekend.  If I don't like one band, I just walk to the other side of the building.
The bathroom is CLEAN!  Retro decor, too.  
Nice staff.  Really hot guys behind the bar :}
